                }
            } else if (node.rawNode) {
                output = node.rawNode.duration; // preserve duration field
                if (!output && node.rawNode.type && (node.rawNode.type.trim() == 'quizz')) {
                    output = defaultDuration4quizz;
                }
            }
        }
        return output;
    }; return doit() ;

