var doit = function () {
        var validateBtnName = 'validateButton';
        var certify = function() {
            var avoidNodes = [];
            var certifyParents = function(node) {
                var certifyNode = function(node) {
                    node.rawNode['icon_1'] = 'Trainings/success_stamp.png';
                    node.rawNode['icon_1.dm_props'] = {
                        'width': 152,
                        'height': 148,
                        'scaleFactor': 7,
                        'imageName': 'Trainings/success_stamp.png'
                    }
                    
                }
                var updateProgression = function(node) {
                    if (node && node.rawNode) {
                        if (!node.children) {
                            if (node.rawNode['icon_1']) node.rawNode.nbOfPassed = 1;
                        } else {
                            var nbOfPassed = 0;
                            var leaves = dm_Tools.getChildrenAtLevel(node);
                            if (leaves) {
                                leaves.forEach(function(leaf) {
                                    if (leaf && leaf.rawNode) {
                                        if (leaf.rawNode['icon_1']) nbOfPassed++;
                                    }
                                });
                            }
                            if (nbOfPassed) node.rawNode.nbOfPassed = nbOfPassed;
                        }

                        if (nbOfPassed > 0) {
                            node.rawNode['gauge_1.dm_props'] = {
                                'value': nbOfPassed,
                                'max': node.rawNode.nbOfChallenges,
                                'y': -21
                            }
                            
                        } else {
                            for (var prop in node.rawNode) {
                                if (prop.indexOf('gauge_1') == 0) delete node.rawNode[prop];
                            }
                        }
                    }
                    if (node.parent && !node.dm_config) updateProgression(node.parent);
                }
                if (node && node.rawNode) {
                    var certifyIt = false;
                    if (!node.children) {
                        certifyIt = true;
                    } else {
                        certifyIt = true;
                        node.children.forEach(function(child) {
                            if (certifyIt) {
                                if (child.rawNode && !child.rawNode['icon_1']) {
                                    certifyIt = false;
                                }
                            }
                        });
                    }
                    if (certifyIt) {
                        certifyNode(node);
                        updateProgression(node);

                        var need2avoid = function(n) {
                            var avoidIt = false;
                            avoidNodes.forEach(function(avoid) {
                                if (!avoidIt && (n == avoid)) avoidIt = true;
                            });
                            return avoidIt;
                        }

                        avoidNodes.push(node);

                        // certify copy
                        if (node.rawNode && node.rawNode.copyOf) {
                            nodes.forEach(function(n) {
                                if (n && n.rawNode && (n.rawNode.uid == node.rawNode.copyOf)) {
                                    if (!need2avoid(n)) certifyParents(n);
                                }
                            });
                        }

                        // certify copies of this node
                        nodes.forEach(function(n) {
                            if (n && n.rawNode && n.rawNode.copyOf && (n.rawNode.copyOf == node.rawNode.uid)) {
                                if (!need2avoid(n)) certifyParents(n);
                            }
                        });

                        certifyParents(node.parent);
                    }
                }
            }

            certifyParents(node);

            dm_UI.autoResize();
        }
        if (node && !node.children && node.rawNode) {
            if (node.rawNode.link) {
                node.rawNode[validateBtnName] = "Validate";
                node.rawNode[validateBtnName + '.dm_props'] = {
                    'image': "Trainings/stamp.png",
                    'type': 'action',
                    'edit': false,
                    'visible': true,
                    'class': 'btn-success',
                    'content.exec': 'var doit = ' + certify + '; doit() ;'
                } ;
                
            }
        }
        return node.rawNode[validateBtnName]; // preserve name cause aggreg prop equals 'actionButton'
    }; return doit() ;

