var doit = function () {
        var isParent = function(node, parentName) {
            var output = false;
            if (node) {
                if (node.name == parentName) {
                    output = true;
                } else {
                    output = isParent(node.parent, parentName);
                }
            }
            return output;
        }
        if (node) {
            if ((node.level >= 2) && (node.level <= 3)) {
                var found = false;
                if (isParent(node, "Awareness Path")) {
                    node.rawNode["icon"] = "Trainings/awareness-module.png";
                    found = true;
                } else if (isParent(node, "Expert Path")) {
                    node.rawNode["icon"] = "Trainings/expert-module.png";
                    found = true;
                } else if (isParent(node, "Architect Path")) {
                    node.rawNode["icon"] = "Trainings/architect-module.png";
                    found = true;
                }
                if (found) {
                    node.rawNode["icon.dm_props"] = {
                        "width": 64,
                        "height": 64,
                        "scaleFactor": (node.level == 2) ? 4.2 : 3.8,
                        "panelMaxHeight": 180,
                        "type": "image",
                        "visible": true
                    } ;
                }
            } else if ((!node.children) && node.rawNode) {
                var found = false;
                if (node.rawNode['type'] == 'video') {
                    node.rawNode["icon"] = "Trainings/video.png";
                    node.rawNode["icon.dm_props"] = {
                        "width": 180,
